import React from "react";
// import { AiOutlineMinus, AiOutlinePlus } from "react-icons/ai";

const Questions = ({ title, info }) => {
  return (
    <article>
      <header>
        <h3>{title}</h3>
      </header>
    </article>
  );
};

export default Questions;
